import { StyleSheet } from 'react-native';
import Theme from '../../styles/colors';

export const styles = StyleSheet.create({
    chartContainer: {
        flex: 1,
        justifyContent: "center",
        alignItems: "center",
        top: 100,
        backgroundColor: Theme.cream
      },
});
